snippet.textDisplay:
আমাদের একজন 'নজরুল' ছিল; আছে; থাকবে আমাদের হৃদয় জুড়ে।🖤
"লাথি মার ভাঙরে তালা;
যত সব বন্দী শালায় আগুন-জ্বালা, আগুন-জ্বালা ফেল উপাড়ি।"

